import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import { usePerformanceAPI } from './hooks/usePerformanceAPI';
import { TestProvider } from './context/TestContext';
import HomePage from './components/HomePage';
import PerformancePage from './components/PerformancePage';
import DashboardPage from './components/DashboardPage';
import { 
  Activity, Brain, Zap, BarChart3, History, Settings, 
  Play, Square, RotateCcw, Target, Users, Clock, TrendingUp,
  AlertTriangle, CheckCircle, X, Plus, Download, Upload, Home
} from 'lucide-react';

function App() {
  const [currentPage, setCurrentPage] = useState('home');
  const [currentTest, setCurrentTest] = useState(null);
  const [testResults, setTestResults] = useState({
    totalRequests: 1000,
    successfulRequests: 920,
    failedRequests: 80,
    avgResponseTime: 392,
    percentile95: 566,
    peakRPS: 57
  });
  const [analysis, setAnalysis] = useState({
    assessment: "Good Performance",
    insights: [
      "Using intelligent fallback analysis",
      "Good success rate with room for minor optimizations",
      "Response times are within acceptable range",
      "High throughput achieved during peak load",
      "AI service temporarily unavailable"
    ],
    bottlenecks: ["Performance degradation detected"],
    recommendations: ["Implement performance optimizations"],
    productionReady: "System needs optimization before production deployment."
  });
  const [testHistory, setTestHistory] = useState([
    {
      type: "Load Test",
      users: 100,
      success_rate: 91,
      avg_response_time: 367,
      peak_rps: 55,
      timestamp: "Just now"
    }
  ]);
  const [testConfig, setTestConfig] = useState({
    type: 'Stress Test',
    url: 'http://localhost:3000',
    users: 500,
    duration: 120,
    rampUp: 10,
    thinkTime: 1000
  });

  const { 
    connectionStatus, 
    loading, 
    error, 
    backendUrl,
    startTest,
    getTestStatus,
    analyzeResults,
    analyzeResultsWithImage,
    listTests,
    getTestHistory,
    getAgentMemory,
    getAgentStatus,
    checkConnection
  } = usePerformanceAPI();

  // Load test history on component mount
  useEffect(() => {
    loadTestHistory();
  }, []);

  const loadTestHistory = async () => {
    try {
      const history = await getTestHistory();
      if (history.success) {
        setTestHistory(history.history || []);
      }
    } catch (error) {
      console.error('Failed to load test history:', error);
    }
  };

  const handleStartTest = async () => {
    if (!testConfig.url.trim()) {
      alert('Please enter a target URL');
      return;
    }
    
    try {
      const result = await startTest(testConfig);
      setCurrentTest(result);
    } catch (error) {
      console.error('Failed to start test:', error);
    }
  };

  const handleStopTest = async () => {
    if (currentTest?.testId) {
      try {
        // Stop test logic would go here
        setCurrentTest(null);
      } catch (error) {
        console.error('Failed to stop test:', error);
      }
    }
  };

  const handleReset = () => {
    setTestConfig({
      type: 'Stress Test',
      url: 'http://localhost:3000',
      users: 500,
      duration: 120,
      rampUp: 10,
      thinkTime: 1000
    });
    setCurrentTest(null);
  };

  const handleNavigate = (page) => {
    setCurrentPage(page);
  };

  const getConnectionStatusColor = () => {
    switch (connectionStatus) {
      case 'connected': return 'text-green-500';
      case 'disconnected': return 'text-red-500';
      case 'checking': return 'text-yellow-500';
      default: return 'text-gray-500';
    }
  };

  const getConnectionStatusText = () => {
    switch (connectionStatus) {
      case 'connected': return 'Connected';
      case 'disconnected': return 'Disconnected';
      case 'checking': return 'Checking...';
      default: return 'Unknown';
    }
  };

  // Render HomePage if currentPage is 'home'
  if (currentPage === 'home') {
    return <HomePage onNavigate={handleNavigate} />;
  }

  // Render PerformancePage if currentPage is 'performance'
  if (currentPage === 'performance') {
    return <PerformancePage onNavigate={handleNavigate} />;
  }

  // Render DashboardPage if currentPage is 'dashboard'
  if (currentPage === 'dashboard') {
    return <DashboardPage onNavigate={handleNavigate} />;
  }

  return (
    <div className="min-h-screen bg-gradient-to-br from-slate-900 via-purple-900 to-slate-900">
      {/* Header */}
      <header className="bg-white/10 backdrop-blur-md border-b border-white/20">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex justify-between items-center h-16">
            <div className="flex items-center space-x-4">
              <div className="flex items-center space-x-2">
                <Brain className="h-8 w-8 text-purple-400" />
                <h1 className="text-xl font-bold text-white">Performance Testing Suite</h1>
              </div>
              <div className="flex items-center space-x-2">
                <div className={`w-2 h-2 rounded-full ${connectionStatus === 'connected' ? 'bg-green-400' : connectionStatus === 'checking' ? 'bg-yellow-400' : 'bg-red-400'}`}></div>
                <span className={`text-sm ${getConnectionStatusColor()}`}>
                  {getConnectionStatusText()}
                </span>
              </div>
            </div>
            
            <div className="flex items-center space-x-4">
              <div className="text-xs text-gray-400">
                Backend: {backendUrl}
              </div>
              {error && (
                <div className="text-xs text-red-400 bg-red-900/20 px-2 py-1 rounded">
                  {error}
                </div>
              )}
            </div>
          </div>
        </div>
      </header>

      {/* Navigation */}
      <nav className="bg-white/5 backdrop-blur-sm border-b border-white/10">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex space-x-8">
            <button 
              onClick={() => handleNavigate('home')}
              className={`flex items-center space-x-2 py-4 px-1 border-b-2 ${currentPage === 'home' ? 'border-purple-400 text-purple-400' : 'border-transparent text-gray-300 hover:text-white'} transition-colors`}
            >
              <Home className="h-5 w-5" />
              <span>Home</span>
            </button>
            <button 
              onClick={() => handleNavigate('performance')}
              className={`flex items-center space-x-2 py-4 px-1 border-b-2 ${currentPage === 'performance' ? 'border-purple-400 text-purple-400' : 'border-transparent text-gray-300 hover:text-white'} transition-colors`}
            >
              <Settings className="h-5 w-5" />
              <span>Performance Testing</span>
            </button>
            <button 
              onClick={() => handleNavigate('dashboard')}
              className={`flex items-center space-x-2 py-4 px-1 border-b-2 ${currentPage === 'dashboard' ? 'border-purple-400 text-purple-400' : 'border-transparent text-gray-300 hover:text-white'} transition-colors`}
            >
              <BarChart3 className="h-5 w-5" />
              <span>Dashboard</span>
            </button>
          </div>
        </div>
      </nav>

      {/* Main Content - Horizontal Layout */}
      <main className="max-w-7xl mx-auto py-6 px-4 sm:px-6 lg:px-8">
        {/* Main Title */}
        <div className="text-center mb-8">
          <h2 className="text-3xl font-bold text-white mb-4">
            AI-Powered Performance Testing
          </h2>
          <p className="text-gray-300 max-w-2xl mx-auto">
            Configure and execute comprehensive performance tests with real-time monitoring and intelligent analysis.
          </p>
        </div>

        {/* Horizontal Cards Layout */}
        <div className="flex flex-col lg:flex-row gap-6">
          
          {/* Card 1: Test Configuration */}
          <div className="flex-1 min-w-0">
            <div className="card h-full">
              <div className="flex items-center space-x-3 mb-4">
                <Settings className="h-6 w-6 text-blue-400" />
                <h3 className="text-lg font-semibold text-white">Test Configuration</h3>
              </div>
              
              <div className="space-y-4">
                <div>
                  <label className="block text-sm font-medium text-gray-300 mb-2">Test Type:</label>
                  <select 
                    value={testConfig.type}
                    onChange={(e) => setTestConfig(prev => ({ ...prev, type: e.target.value }))}
                    className="input-field w-full"
                  >
                    <option value="Load Test">Load Test</option>
                    <option value="Stress Test">Stress Test</option>
                    <option value="Spike Test">Spike Test</option>
                    <option value="Soak Test">Soak Test</option>
                  </select>
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-300 mb-2">Target URL:</label>
                  <input
                    type="url"
                    value={testConfig.url}
                    onChange={(e) => setTestConfig(prev => ({ ...prev, url: e.target.value }))}
                    className="input-field w-full"
                  />
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-300 mb-2">Number of Users:</label>
                  <input
                    type="number"
                    value={testConfig.users}
                    onChange={(e) => setTestConfig(prev => ({ ...prev, users: parseInt(e.target.value) || 0 }))}
                    className="input-field w-full"
                  />
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-300 mb-2">Duration (seconds):</label>
                  <input
                    type="number"
                    value={testConfig.duration}
                    onChange={(e) => setTestConfig(prev => ({ ...prev, duration: parseInt(e.target.value) || 0 }))}
                    className="input-field w-full"
                  />
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-300 mb-2">Ramp-up Time (seconds):</label>
                  <input
                    type="number"
                    value={testConfig.rampUp}
                    onChange={(e) => setTestConfig(prev => ({ ...prev, rampUp: parseInt(e.target.value) || 0 }))}
                    className="input-field w-full"
                  />
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-300 mb-2">Think Time (ms):</label>
                  <input
                    type="number"
                    value={testConfig.thinkTime}
                    onChange={(e) => setTestConfig(prev => ({ ...prev, thinkTime: parseInt(e.target.value) || 0 }))}
                    className="input-field w-full"
                  />
                </div>

                <div className="flex space-x-2 pt-4">
                  <motion.button
                    whileHover={{ scale: 1.05 }}
                    whileTap={{ scale: 0.95 }}
                    onClick={handleStartTest}
                    disabled={loading}
                    className="btn-primary flex-1"
                  >
                    <Play className="h-4 w-4 mr-2" />
                    Start Test
                  </motion.button>
                  <motion.button
                    whileHover={{ scale: 1.05 }}
                    whileTap={{ scale: 0.95 }}
                    onClick={handleStopTest}
                    className="btn-secondary"
                  >
                    <Square className="h-4 w-4 mr-2" />
                    Stop Test
                  </motion.button>
                  <motion.button
                    whileHover={{ scale: 1.05 }}
                    whileTap={{ scale: 0.95 }}
                    onClick={handleReset}
                    className="btn-secondary"
                  >
                    <RotateCcw className="h-4 w-4 mr-2" />
                    Reset
                  </motion.button>
                </div>
              </div>
            </div>
          </div>

          {/* Card 2: Real-time Monitoring */}
          <div className="flex-1 min-w-0">
            <div className="card h-full">
              <div className="flex items-center space-x-3 mb-4">
                <BarChart3 className="h-6 w-6 text-green-400" />
                <h3 className="text-lg font-semibold text-white">Real-time Monitoring</h3>
              </div>
              
              <div className="space-y-4">
                <div className="text-center">
                  <div className="text-3xl font-bold text-blue-400">{testConfig.users}</div>
                  <div className="text-sm text-gray-400">Active Users</div>
                </div>
                
                <div className="text-center">
                  <div className="text-3xl font-bold text-green-400">222ms</div>
                  <div className="text-sm text-gray-400">Avg Response Time</div>
                </div>
                
                <div className="text-center">
                  <div className="text-3xl font-bold text-yellow-400">96%</div>
                  <div className="text-sm text-gray-400">Success Rate</div>
                </div>
                
                <div className="text-center">
                  <div className="text-3xl font-bold text-purple-400">41</div>
                  <div className="text-sm text-gray-400">Requests/sec</div>
                </div>
                
                <div className="text-center pt-4">
                  <div className="text-lg font-bold text-green-400">100% Complete</div>
                </div>
              </div>
            </div>
          </div>

          {/* Card 3: Test Results */}
          <div className="flex-1 min-w-0">
            <div className="card h-full">
              <div className="flex items-center space-x-3 mb-4">
                <Zap className="h-6 w-6 text-yellow-400" />
                <h3 className="text-lg font-semibold text-white">Test Results</h3>
              </div>
              
              <div className="space-y-4">
                <h4 className="text-md font-semibold text-white">Test Summary</h4>
                
                <div className="space-y-2">
                  <div className="flex justify-between">
                    <span className="text-gray-300">Total Requests:</span>
                    <span className="text-white font-semibold">{testResults.totalRequests.toLocaleString()}</span>
                  </div>
                  <div className="flex justify-between">
                    <span className="text-gray-300">Successful Requests:</span>
                    <span className="text-white font-semibold">{testResults.successfulRequests.toLocaleString()}</span>
                  </div>
                  <div className="flex justify-between">
                    <span className="text-gray-300">Failed Requests:</span>
                    <span className="text-white font-semibold">{testResults.failedRequests.toLocaleString()}</span>
                  </div>
                  <div className="flex justify-between">
                    <span className="text-gray-300">Average Response Time:</span>
                    <span className="text-white font-semibold">{testResults.avgResponseTime}ms</span>
                  </div>
                  <div className="flex justify-between">
                    <span className="text-gray-300">95th Percentile:</span>
                    <span className="text-white font-semibold">{testResults.percentile95}ms</span>
                  </div>
                  <div className="flex justify-between">
                    <span className="text-gray-300">Peak RPS:</span>
                    <span className="text-white font-semibold">{testResults.peakRPS}</span>
                  </div>
                </div>
                
                <div className="pt-4">
                  <h5 className="text-sm font-semibold text-white mb-2">Response Time Distribution</h5>
                  <div className="h-20 bg-gray-800 rounded flex items-center justify-center">
                    <span className="text-gray-400 text-sm">Chart Placeholder</span>
                  </div>
                </div>
                
                <div>
                  <h5 className="text-sm font-semibold text-white mb-2">Requests Over Time</h5>
                  <div className="h-20 bg-gray-800 rounded flex items-center justify-center">
                    <span className="text-gray-400 text-sm">Chart Placeholder</span>
                  </div>
                </div>
              </div>
            </div>
          </div>

          {/* Card 4: AI Analysis */}
          <div className="flex-1 min-w-0">
            <div className="card h-full">
              <div className="flex items-center space-x-3 mb-4">
                <Brain className="h-6 w-6 text-purple-400" />
                <h3 className="text-lg font-semibold text-white">AI Analysis</h3>
              </div>
              
              <div className="space-y-4">
                <div className="flex items-start space-x-2">
                  <AlertTriangle className="h-5 w-5 text-yellow-400 mt-0.5 flex-shrink-0" />
                  <p className="text-gray-300 text-sm">
                    <span className="font-semibold text-white">Good Performance:</span> AI analysis indicates good performance with 92% success rate.
                  </p>
                </div>
                
                <div>
                  <h5 className="text-sm font-semibold text-white mb-2">AI Insights:</h5>
                  <ul className="space-y-1">
                    {analysis.insights.map((insight, index) => (
                      <li key={index} className="text-gray-300 text-sm flex items-start space-x-2">
                        <div className="w-1.5 h-1.5 bg-purple-400 rounded-full mt-2 flex-shrink-0"></div>
                        <span>{insight}</span>
                      </li>
                    ))}
                  </ul>
                </div>
                
                <div>
                  <h5 className="text-sm font-semibold text-white mb-2 flex items-center space-x-2">
                    <AlertTriangle className="h-4 w-4 text-yellow-400" />
                    <span>Potential Bottlenecks:</span>
                  </h5>
                  <ul className="space-y-1">
                    {analysis.bottlenecks.map((bottleneck, index) => (
                      <li key={index} className="text-gray-300 text-sm flex items-start space-x-2">
                        <div className="w-1.5 h-1.5 bg-yellow-400 rounded-full mt-2 flex-shrink-0"></div>
                        <span>{bottleneck}</span>
                      </li>
                    ))}
                  </ul>
                </div>
                
                <div>
                  <h5 className="text-sm font-semibold text-white mb-2 flex items-center space-x-2">
                    <Settings className="h-4 w-4 text-blue-400" />
                    <span>AI Recommendations:</span>
                  </h5>
                  <ul className="space-y-1">
                    {analysis.recommendations.map((recommendation, index) => (
                      <li key={index} className="text-gray-300 text-sm flex items-start space-x-2">
                        <div className="w-1.5 h-1.5 bg-blue-400 rounded-full mt-2 flex-shrink-0"></div>
                        <span>{recommendation}</span>
                      </li>
                    ))}
                  </ul>
                </div>
                
                <div className="flex items-start space-x-2">
                  <div className="w-2 h-2 bg-red-400 rounded-full mt-2 flex-shrink-0"></div>
                  <p className="text-gray-300 text-sm">
                    <span className="font-semibold text-white">Production Readiness:</span> {analysis.productionReady}
                  </p>
                </div>
              </div>
            </div>
          </div>

          {/* Card 5: Recent Test History */}
          <div className="flex-1 min-w-0">
            <div className="card h-full">
              <div className="flex items-center space-x-3 mb-4">
                <History className="h-6 w-6 text-orange-400" />
                <h3 className="text-lg font-semibold text-white">Recent Test History</h3>
              </div>
              
              <div className="space-y-4">
                {testHistory.map((test, index) => (
                  <div key={index} className="border border-gray-700 rounded-lg p-3">
                    <div className="flex items-center space-x-2 mb-2">
                      <AlertTriangle className="h-4 w-4 text-yellow-400" />
                      <span className="font-semibold text-white">{test.type} - {test.users} Users</span>
                    </div>
                    <p className="text-gray-300 text-sm mb-2">
                      Good performance with minor issues with {test.success_rate}% success rate
                    </p>
                    <div className="text-gray-400 text-sm">
                      Avg Response: {test.avg_response_time}ms | Peak RPS: {test.peak_rps}
                    </div>
                    <div className="text-gray-500 text-xs mt-1">
                      {test.timestamp}
                    </div>
                  </div>
                ))}
              </div>
            </div>
          </div>
        </div>
      </main>
    </div>
  );
}

const AppWrapper = () => {
  return (
    <TestProvider>
      <App />
    </TestProvider>
  );
};

export default AppWrapper;
